import React, {
  useRef, useState, useEffect} from 'react';
import './Header.css';
import '../ProfilePage.css'
import axios from 'axios';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
 

export default function Header() {
  //get the username from the cookies
  const navigate = useNavigate();
  const [value, setValue] = useState('');
  const [suggested, setSuggested] = useState([]);
  //split on input, see if size 2 - check if the first letters are in a user's first name, then check last name
// call get all users from backend, store in array, and get the similar suggested users, then re-render
  const search = (e, val)=> {
    //get the username based on the full name from the backend, and use that in the profile route
    e.preventDefault();
    setSuggested(arr => []);
    setValue(val)
    navigate("/profile/" + val);
    window.location.reload();
  }

  //logout functionality:
  //set local storage to empty, make axios call to update the user's status, and redirect to login
  const logout = (e) => {
    e.preventDefault();
    setSuggested(arr => []);
    setValue('');
    console.log(localStorage.getItem("user"));
    axios.post('http://3.236.144.208:80/logoutUser', {username: localStorage.getItem("user")}).then((res) => {
          console.log(res.data);
          window.localStorage.clear();
          navigate("/");
      }).catch((error) => {
          console.log(error)
      });
    };

  useEffect(() => {
  }, []);
  const suggest = async (e) => {
    e.preventDefault();
    //suggested.splice(0, suggested.length);
    const names = [];
    setValue(e.target.value);
    console.log(e.target);
    //console.log(value);
    const searchTerm = e.target.value.toLowerCase();
    console.log(searchTerm);

    const response = await axios.get('http://3.236.144.208:80/getAllUsers').then((res) => {
      console.log(res.data);
      res.data.forEach((item) => {
        //console.log(item.firstname);
        const fullName = (item.firstname + " " + item.lastname);
        const cleaned = fullName.toLowerCase();
        if (searchTerm !== "" && cleaned.startsWith(searchTerm)) {
          //console.log("prefix!");
          //console.log(cleaned);
          names.push([fullName, item.username]); //include username?
        }
      });
    //console.log(names);
    setSuggested(arr => names);
        // check if the current search term is a prefix of the user's name for each name, 
        // make sure to check for caps and not caps- maybe preemptively just set both to lowercase
      
    }).catch((error) => {
      console.log(error)
    });

  }

  return (
    <div className="topnav">
      <div className="leftTopNav">
        <h1 className="appLogo"><center> Mini Meta </center></h1>
      </div>
      
      <div className="sCointain">
        
          <div className="search-inner2">
            
            <div className="search1">
              <input 
              className="search-inner"
              type="text"
              id="search"
              value={value}
              placeholder="Search for users by name..."
              onChange= {suggest} />
              <div className="dropdown">
                {suggested.map((item, index)  => {
                    return (<div
                      onClick={(e) => search(e, item[1])}
                      className="dropdown-row"
                      key={item[0]}
                    >
                      {item[0]}
                    </div>
                    )
                 })
                }
              </div>  
            </div>
            <button onClick={(e) => search(e, value)}> Search </button>
            
          </div>
      <div className="groupings"> 

      <div className="icon2" id="i5">
        <Link to="/">
          <img src="https://cdn-icons-png.flaticon.com/512/2767/2767155.png" width="25" height="25" alt="home/profile icon" onClick={(e) => logout(e)}
/>
        </Link>
      </div>
        
      <div className="icon2" id="i1">
        <Link to="/editprofile">
          <img src="https://cdn.iconscout.com/icon/premium/png-256-thumb/profile-page-7-625305.png" width="30" height="30" alt="home/profile icon" />
        </Link>
      </div>
      
        <div className="icon2" id="i3">
        <Link to="/chat">
          <img src="https://cdn-icons-png.flaticon.com/512/14/14558.png" width="25" height="25" alt="home/profile icon" />
        </Link>
      </div>
       <div className="icon2" id="i4">
        <Link to="/newsfeed">
          <img src="https://cdn-icons-png.flaticon.com/512/1946/1946419.png" width="25" height="25" alt="home/profile icon" />
        </Link>
      </div>
       
      <div className="icon2" id="i3">
        <Link to="/home">
          <img src="https://cdn0.iconfinder.com/data/icons/places-16/24/house-door-512.png" width="25" height="25" alt="home/profile icon" />
        </Link>
      </div>

      <div className="icon2" id="i5">
        <Link to="/visualizer">
          <img src="data:image/svg+xml;base64," width="25" height="25" alt="home/profile icon" />
        </Link>
      </div>

      <div className="icon2" id="i0">
        <Link to={"/profile/"+localStorage.getItem("user")}>
          <img src="data:image/png;base64," width="30" height="30" alt="home/profile icon" />
        </Link>
      </div> 
      
     </div>
      </div>
    </div>

  );
}
